<script>

  let selected = JSON.parse(localStorage.getItem("selectedParts") || "[]");


  selected.forEach(id => {
    const el = document.getElementById(id);
    if (el) el.classList.add("selected");
  });

 
  document.querySelectorAll(".part").forEach(p => {
    p.addEventListener("click", () => {
      p.classList.toggle("selected");

      if (p.classList.contains("selected")) {
        if (!selected.includes(p.id)) selected.push(p.id);
      } else {
        selected = selected.filter(x => x !== p.id);
      }


      localStorage.setItem("selectedParts", JSON.stringify(selected));
    });
  });
</script>
